import React from 'react';
import { FaEnvelope, FaPhone } from 'react-icons/fa';

const Support = () => {
  return (
    <div className="p-6 bg-white dark:bg-gray-800 rounded-lg shadow-md">
      <h1 className="text-2xl font-bold mb-4 text-gray-900 dark:text-white">Support</h1>
      <p className="text-gray-700 dark:text-gray-300 mb-6">If you have any problems, please contact us:</p>
      <div className="space-y-4">
        <div className="flex items-center">
          <FaEnvelope className="w-5 h-5 text-blue-500 mr-3" />
          <span className="text-gray-900 dark:text-white">Email: easy delivery@gmail.com</span>
        </div>
        <div className="flex items-center">
          <FaPhone className="w-5 h-5 text-green-500 mr-3" />
          <span className="text-gray-900 dark:text-white">Phone: 0123456768</span>
        </div>
      </div>
    </div>
  );
};

export default Support;
